import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircle, faHouse, faCaretLeft, faCaretRight, faPalette } from '@fortawesome/free-solid-svg-icons';
import { Link } from 'react-router-dom';

enum EngineTypes {
  Diesel = "Diesel",
  Petrol = "Petrol",
  Electric = "Electric",
  Hybrid = "Hybrid",
}

interface ColorInfo {
  name: string;
  hex: string;
  color: string;
}

enum CarColor {
  IndianRed = "Indian red",
  Gummental = "Gummental",
  MintCream = "Mint cream",
  Black = "Black", 
  Zaffre = "Zaffre",
  NonPhotoBlue = "Non Photo Blue",
  UclaBlue = "UCLA Blue",
  Licorice = "Licorice",
  Beige = "Beige",
}

const colorMapSportsCar: Record<CarColor, ColorInfo> = {
  [CarColor.IndianRed]: { name: "Indian red", hex: "#F2545B", color: "white" },
  [CarColor.Gummental]: { name: "Gummental", hex: "#19323C", color: "white" },
  [CarColor.MintCream]: { name: "Mint cream", hex: "#F3F7F0", color: "black" },
  [CarColor.Black]: { name: "Black", hex: "#000000", color: "white" },
  [CarColor.Zaffre]: { name: "Zaffre", hex: "#3626A7", color: "white" },
  [CarColor.NonPhotoBlue]: { name: "Non Photo Blue", hex: "#9ED8DB", color: "black" },
  [CarColor.UclaBlue]: { name: "UCLA Blue", hex: "#467599", color: "white" },
  [CarColor.Licorice]: { name: "Licorice", hex: "#0D0106", color: "white" },
  [CarColor.Beige]: { name: "Beige", hex: "#EEF5DB", color: "black" },
};

const SportsCarColor = {
  carColor: colorMapSportsCar,
};

const CarColorForm = () => {
  return (
    <div>
      <div className='engine-type'>
        <div className='header'>
          <Link to="/">
            <h3><FontAwesomeIcon icon={faHouse} /></h3>
          </Link>
          <div className='progress'>
            <FontAwesomeIcon className="active" icon={faCircle} />
            <FontAwesomeIcon className="active" icon={faCircle} />
            <FontAwesomeIcon className="icon" icon={faCircle} />
            <FontAwesomeIcon className="icon" icon={faCircle} />
            <FontAwesomeIcon className="icon" icon={faCircle} />
            <FontAwesomeIcon className="icon" icon={faCircle} />
            <FontAwesomeIcon className="icon" icon={faCircle} />
          </div>
        </div>
      </div>
      <div>
        <h1 className='title'><FontAwesomeIcon icon={faPalette} /> Color</h1>
        {Object.values(CarColor).map((color: CarColor) => {
          const colorInfo = SportsCarColor.carColor[color];
          return (
            <div className='input-colors' key={color}>
              <h3 style={{ backgroundColor: colorInfo.hex, color: colorInfo.color }} className='text-white'>{colorInfo.name}</h3>
            </div>
          );
        })}
        <div>
          <Link to="/select-engine"><button className='navButton'><FontAwesomeIcon icon={faCaretLeft} /></button></Link>
          <Link to="/select-doors"><button className='navButton'><FontAwesomeIcon icon={faCaretRight} /></button></Link>
        </div>
      </div>
    </div>
  );
};

export default CarColorForm;
